contracts/LoanChainV2.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

/**
 * @title LoanChainV2
 * @dev Enhanced decentralized P2P lending with multi-token support and advanced DeFi features
 */
contract LoanChainV2 is ReentrancyGuard, Ownable {
    using SafeERC20 for IERC20;

    enum LoanStatus { 
        REQUESTED,     // Loan requested by borrower
        FUNDED,        // Loan funded by lender
        PARTIALLY_FUNDED, // Partial funding enabled
        REPAID,        // Loan fully repaid
        DEFAULTED,     // Loan defaulted (collateral liquidated)
        CANCELLED      // Loan cancelled by borrower
    }

    enum TokenType {
        NATIVE_ETH,
        USDC,
        DAI,
        USDT,
        GOVERNANCE_TOKEN
    }

    struct Token {
        address contractAddress;
        TokenType tokenType;
        uint8 decimals;
        bool isActive;
        uint256 minLoanAmount;
        uint256 maxLoanAmount;
    }

    struct Loan {
        uint256 id;
        address borrower;
        address[] lenders;          // Support multiple lenders
        uint256[] lenderAmounts;    // Amount funded by each lender
        uint256 totalAmount;        // Total loan amount
        uint256 totalFunded;        // Amount funded so far
        TokenType loanToken;        // Token type for the loan
        TokenType collateralToken;  // Token type for collateral
        uint256 collateralAmount;   // Collateral amount
        uint256 interestRate;       // Base interest rate (basis points)
        bool isVariableRate;        // Variable rate loan
        uint256 duration;           // Loan duration in seconds
        uint256 createdAt;          // Creation timestamp
        uint256 fundedAt;           // Funding completion timestamp
        uint256 dueDate;            // Repayment due date
        LoanStatus status;
        bool collateralClaimed;
        uint256 riskScore;          // AI-calculated risk score
        bool hasInsurance;          // Lender insurance option
        uint256 insuranceFee;       // Insurance fee amount
    }

    struct LenderPosition {
        address lender;
        uint256 amount;
        uint256 fundedAt;
        bool repaid;
        uint256 repaidAmount;
    }

    // State variables
    uint256 public nextLoanId = 1;
    uint256 public constant MIN_COLLATERAL_RATIO = 120; // 120% for cross-collateral
    uint256 public constant MAX_INTEREST_RATE = 3000;   // 30% max interest
    uint256 public constant MIN_LOAN_DURATION = 1 hours; // Reduced for testing
    uint256 public constant MAX_LOAN_DURATION = 365 days;

    // Multi-token support
    mapping(TokenType => Token) public supportedTokens;
    mapping(uint256 => Loan) public loans;
    mapping(uint256 => mapping(address => LenderPosition)) public lenderPositions;
    mapping(address => uint256[]) public borrowerLoans;
    mapping(address => uint256[]) public lenderLoans;

    // Multi-oracle price system for enhanced security
    struct PriceData {
        uint256 price;         // Price in USD with 8 decimals
        uint256 lastUpdate;    // Last update timestamp
        uint256 priceSource1;  // First price source
        uint256 priceSource2;  // Second price source  
        uint256 updateCount;   // Number of updates
    }

    mapping(TokenType => PriceData) public tokenPrices;
    mapping(address => bool) public priceOracles; // Approved price oracle addresses

    uint256 private constant PRICE_STALENESS_THRESHOLD = 3600; // 1 hour
    uint256 private constant MAX_PRICE_DEVIATION = 1000; // 10% in basis points

    // Insurance Pool Management
    mapping(TokenType => uint256) public insurancePools; // Insurance funds by token type
    mapping(uint256 => mapping(address => bool)) public hasClaimedInsurance; // Track claimed insurance by loan ID and lender
    mapping(address => uint256) public lenderInsuranceContributions; // Track lender contributions

    uint256 public constant INSURANCE_RATE = 100; // 1% insurance fee in basis points
    uint256 public constant CLAIM_GRACE_PERIOD = 7 days; // Grace period before claims allowed

    // Events
    event LoanRequested(
        uint256 indexed loanId,
        address indexed borrower,
        uint256 totalAmount,
        TokenType loanToken,
        TokenType collateralToken,
        uint256 collateralAmount,
        uint256 interestRate,
        uint256 duration,
        bool isVariableRate
    );

    event LoanPartiallyFunded(
        uint256 indexed loanId,
        address indexed lender,
        uint256 amount,
        uint256 totalFunded
    );

    event LoanFullyFunded(
        uint256 indexed loanId,
        uint256 totalFunded,
        uint256 fundedAt
    );

    event LoanRepaid(
        uint256 indexed loanId,
        address indexed borrower,
        uint256 totalRepaidAmount
    );

    event PartialRepayment(
        uint256 indexed loanId,
        address indexed lender,
        uint256 repaidAmount
    );

    event TokenAdded(TokenType indexed tokenType, address indexed contractAddress);
    event PriceUpdated(TokenType indexed tokenType, uint256 newPrice);
    event PriceOracleUpdated(address indexed oracle, bool approved);
    event InsuranceFeeCollected(uint256 indexed loanId, TokenType indexed token, uint256 amount);
    event InsuranceClaimed(uint256 indexed loanId, address indexed lender, uint256 amount);
    event InsurancePoolContribution(TokenType indexed token, uint256 amount);

    constructor() Ownable(msg.sender) {
        // Initialize supported tokens
        _initializeTokens();
    }

    /**
     * @dev Initialize supported tokens with mock addresses for development
     */
    function _initializeTokens() internal {
        // ETH (native)
        supportedTokens[TokenType.NATIVE_ETH] = Token({
            contractAddress: address(0),
            tokenType: TokenType.NATIVE_ETH,
            decimals: 18,
            isActive: true,
            minLoanAmount: 0.01 ether,
            maxLoanAmount: 1000 ether
        });

        // Initialize price data (8 decimals)
        tokenPrices[TokenType.NATIVE_ETH] = PriceData({
            price: 250000000000,
            lastUpdate: block.timestamp,
            priceSource1: 250000000000,
            priceSource2: 250000000000,
            updateCount: 1
        });
        tokenPrices[TokenType.USDC] = PriceData({
            price: 100000000,
            lastUpdate: block.timestamp,
            priceSource1: 100000000,
            priceSource2: 100000000,
            updateCount: 1
        });
        tokenPrices[TokenType.DAI] = PriceData({
            price: 100000000,
            lastUpdate: block.timestamp,
            priceSource1: 100000000,
            priceSource2: 100000000,
            updateCount: 1
        });
        tokenPrices[TokenType.USDT] = PriceData({
            price: 100000000,
            lastUpdate: block.timestamp,
            priceSource1: 100000000,
            priceSource2: 100000000,
            updateCount: 1
        });

        // Owner is initially approved as price oracle (can be removed later)
        priceOracles[msg.sender] = true;
    }

    /**
     * @dev Add or update supported token
     */
    function addSupportedToken(
        TokenType _tokenType,
        address _contractAddress,
        uint8 _decimals,
        uint256 _minLoanAmount,
        uint256 _maxLoanAmount
    ) external onlyOwner {
        supportedTokens[_tokenType] = Token({
            contractAddress: _contractAddress,
            tokenType: _tokenType,
            decimals: _decimals,
            isActive: true,
            minLoanAmount: _minLoanAmount,
            maxLoanAmount: _maxLoanAmount
        });

        emit TokenAdded(_tokenType, _contractAddress);
    }

    /**
     * @dev Add or remove price oracle (decentralized governance)
     */
    function setPriceOracle(address _oracle, bool _approved) external onlyOwner {
        priceOracles[_oracle] = _approved;
        emit PriceOracleUpdated(_oracle, _approved);
    }

    /**
     * @dev Update token price with validation (multi-oracle system)
     */
    function updateTokenPrice(TokenType _tokenType, uint256 _price1, uint256 _price2) external {
        require(priceOracles[msg.sender], "Not authorized price oracle");
        require(_price1 > 0 && _price2 > 0, "Invalid prices");

        PriceData storage priceData = tokenPrices[_tokenType];

        // Calculate average price from two sources
        uint256 avgPrice = (_price1 + _price2) / 2;

        // Validate price deviation (max 10% difference between sources)
        uint256 deviation = _price1 > _price2 
            ? ((_price1 - _price2) * 10000) / _price2
            : ((_price2 - _price1) * 10000) / _price1;
        require(deviation <= MAX_PRICE_DEVIATION, "Price sources deviate too much");

        // If not first price update, validate against existing price
        if (priceData.updateCount > 0) {
            uint256 priceDeviation = avgPrice > priceData.price
                ? ((avgPrice - priceData.price) * 10000) / priceData.price
                : ((priceData.price - avgPrice) * 10000) / avgPrice;
            require(priceDeviation <= MAX_PRICE_DEVIATION * 3, "New price deviates too much from current");
        }

        // Update price data
        priceData.price = avgPrice;
        priceData.lastUpdate = block.timestamp;
        priceData.priceSource1 = _price1;
        priceData.priceSource2 = _price2;
        priceData.updateCount++;

        emit PriceUpdated(_tokenType, avgPrice);
    }

    /**
     * @dev Calculate USD value of token amount
     */
    function calculateUSDValue(TokenType _tokenType, uint256 _amount) public view returns (uint256) {
        Token memory token = supportedTokens[_tokenType];
        PriceData memory priceData = tokenPrices[_tokenType];

        // Check if price is not stale
        require(
            block.timestamp - priceData.lastUpdate <= PRICE_STALENESS_THRESHOLD,
            "Price data is stale"
        );

        // Convert amount to USD value (8 decimals)
        return (_amount * priceData.price) / (10 ** token.decimals);
    }

    /**
     * @dev Check if collateral is sufficient for cross-collateral loans
     */
    function _isCollateralSufficient(
        TokenType _loanToken,
        uint256 _loanAmount,
        TokenType _collateralToken,
        uint256 _collateralAmount
    ) internal view returns (bool) {
        uint256 loanValueUSD = calculateUSDValue(_loanToken, _loanAmount);
        uint256 collateralValueUSD = calculateUSDValue(_collateralToken, _collateralAmount);

        // Require 120% collateralization
        uint256 requiredCollateralUSD = (loanValueUSD * MIN_COLLATERAL_RATIO) / 100;

        return collateralValueUSD >= requiredCollateralUSD;
    }

    /**
     * @dev Request a new loan with specified tokens
     */
    function requestLoan(
        uint256 _totalAmount,
        TokenType _loanToken,
        TokenType _collateralToken,
        uint256 _collateralAmount,
        uint256 _interestRate,
        uint256 _duration,
        bool _isVariableRate,
        bool _hasInsurance
    ) external payable nonReentrant {
        require(_totalAmount > 0, "Loan amount must be greater than 0");
        require(_interestRate <= MAX_INTEREST_RATE, "Interest rate too high");
        require(_duration >= MIN_LOAN_DURATION && _duration <= MAX_LOAN_DURATION, "Invalid duration");
        require(supportedTokens[_loanToken].isActive, "Loan token not supported");
        require(supportedTokens[_collateralToken].isActive, "Collateral token not supported");

        // Check collateral sufficiency for cross-collateral
        require(
            _isCollateralSufficient(_loanToken, _totalAmount, _collateralToken, _collateralAmount),
            "Insufficient collateral"
        );

        uint256 loanId = nextLoanId++;

        // Calculate insurance fee first
        uint256 insuranceFee = 0;
        if (_hasInsurance) {
            insuranceFee = (_totalAmount * INSURANCE_RATE) / 10000; // 1% insurance fee
        }

        // Handle collateral and insurance fee collection
        if (_collateralToken == TokenType.NATIVE_ETH) {
            uint256 requiredETH = _collateralAmount;
            if (_hasInsurance && _loanToken == TokenType.NATIVE_ETH) {
                requiredETH += insuranceFee;
            }
            require(msg.value == requiredETH, "ETH sent must match collateral plus insurance fee (if applicable)");
        } else {
            // ERC20 collateral case
            if (_hasInsurance && _loanToken == TokenType.NATIVE_ETH) {
                require(msg.value == insuranceFee, "Must send exact ETH insurance fee");
            } else {
                require(msg.value == 0, "No ETH should be sent");
            }
            // Transfer ERC20 collateral tokens
            Token memory collateralToken = supportedTokens[_collateralToken];
            IERC20(collateralToken.contractAddress).safeTransferFrom(
                msg.sender,
                address(this),
                _collateralAmount
            );
        }

        // Collect insurance fee if applicable
        if (_hasInsurance) {
            if (_loanToken != TokenType.NATIVE_ETH) {
                // For ERC20 loan tokens, collect insurance fee separately
                Token memory loanTokenInfo = supportedTokens[_loanToken];
                IERC20(loanTokenInfo.contractAddress).safeTransferFrom(
                    msg.sender,
                    address(this),
                    insuranceFee
                );
            }
            // ETH insurance fee already collected above with collateral/msg.value

            // Add to insurance pool
            insurancePools[_loanToken] += insuranceFee;
            emit InsuranceFeeCollected(loanId, _loanToken, insuranceFee);
        }

        loans[loanId] = Loan({
            id: loanId,
            borrower: msg.sender,
            lenders: new address[](0),
            lenderAmounts: new uint256[](0),
            totalAmount: _totalAmount,
            totalFunded: 0,
            loanToken: _loanToken,
            collateralToken: _collateralToken,
            collateralAmount: _collateralAmount,
            interestRate: _interestRate,
            isVariableRate: _isVariableRate,
            duration: _duration,
            createdAt: block.timestamp,
            fundedAt: 0,
            dueDate: 0,
            status: LoanStatus.REQUESTED,
            collateralClaimed: false,
            riskScore: 500, // Default risk score, can be updated by oracle
            hasInsurance: _hasInsurance,
            insuranceFee: insuranceFee
        });

        borrowerLoans[msg.sender].push(loanId);

        emit LoanRequested(
            loanId,
            msg.sender,
            _totalAmount,
            _loanToken,
            _collateralToken,
            _collateralAmount,
            _interestRate,
            _duration,
            _isVariableRate
        );
    }

    /**
     * @dev Fund a loan (supports partial funding)
     */
    function fundLoan(uint256 _loanId, uint256 _amount) external payable nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.borrower != address(0), "Loan does not exist");
        require(loan.status == LoanStatus.REQUESTED || loan.status == LoanStatus.PARTIALLY_FUNDED, "Loan not available");
        require(msg.sender != loan.borrower, "Cannot fund your own loan");
        require(_amount > 0, "Funding amount must be greater than 0");
        require(loan.totalFunded + _amount <= loan.totalAmount, "Exceeds loan amount");

        // Handle loan token transfer
        if (loan.loanToken == TokenType.NATIVE_ETH) {
            require(msg.value == _amount, "Incorrect ETH amount sent");
        } else {
            Token memory loanToken = supportedTokens[loan.loanToken];
            IERC20(loanToken.contractAddress).safeTransferFrom(
                msg.sender,
                address(this),
                _amount
            );
        }

        // Record lender position
        lenderPositions[_loanId][msg.sender] = LenderPosition({
            lender: msg.sender,
            amount: _amount,
            fundedAt: block.timestamp,
            repaid: false,
            repaidAmount: 0
        });

        // Update loan funding
        loan.lenders.push(msg.sender);
        loan.lenderAmounts.push(_amount);
        loan.totalFunded += _amount;
        lenderLoans[msg.sender].push(_loanId);

        if (loan.totalFunded >= loan.totalAmount) {
            // Loan fully funded
            loan.status = LoanStatus.FUNDED;
            loan.fundedAt = block.timestamp;
            loan.dueDate = block.timestamp + loan.duration;

            // Transfer full loan amount to borrower
            _transferTokens(loan.loanToken, loan.borrower, loan.totalAmount);

            emit LoanFullyFunded(_loanId, loan.totalFunded, block.timestamp);
        } else {
            // Partial funding
            loan.status = LoanStatus.PARTIALLY_FUNDED;
            emit LoanPartiallyFunded(_loanId, msg.sender, _amount, loan.totalFunded);
        }
    }

    /**
     * @dev Repay a loan with interest (supports multi-lender repayment)
     */
    function repayLoan(uint256 _loanId) external payable nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.borrower == msg.sender, "Only borrower can repay");
        require(loan.status == LoanStatus.FUNDED, "Loan not active");
        require(block.timestamp <= loan.dueDate, "Loan expired");

        // Calculate total repayment amount with interest
        uint256 interest = (loan.totalAmount * loan.interestRate) / 10000;
        uint256 totalRepayment = loan.totalAmount + interest;

        // Handle repayment based on loan token type
        if (loan.loanToken == TokenType.NATIVE_ETH) {
            require(msg.value >= totalRepayment, "Insufficient repayment amount");

            // Distribute repayment to all lenders proportionally
            for (uint256 i = 0; i < loan.lenders.length; i++) {
                address lender = loan.lenders[i];
                uint256 lenderShare = loan.lenderAmounts[i];
                uint256 lenderInterest = (lenderShare * loan.interestRate) / 10000;
                uint256 lenderRepayment = lenderShare + lenderInterest;

                (bool success, ) = payable(lender).call{value: lenderRepayment}("");
                require(success, "Transfer to lender failed");

                // Update lender position
                lenderPositions[_loanId][lender].repaid = true;
                lenderPositions[_loanId][lender].repaidAmount = lenderRepayment;
            }

            // Return excess ETH to borrower
            if (msg.value > totalRepayment) {
                (bool success, ) = payable(msg.sender).call{value: msg.value - totalRepayment}("");
                require(success, "Excess return failed");
            }
        } else {
            require(msg.value == 0, "ETH not needed for ERC20 repayment");
            Token memory loanToken = supportedTokens[loan.loanToken];
            IERC20 tokenContract = IERC20(loanToken.contractAddress);

            // Distribute repayment to all lenders proportionally
            for (uint256 i = 0; i < loan.lenders.length; i++) {
                address lender = loan.lenders[i];
                uint256 lenderShare = loan.lenderAmounts[i];
                uint256 lenderInterest = (lenderShare * loan.interestRate) / 10000;
                uint256 lenderRepayment = lenderShare + lenderInterest;

                tokenContract.safeTransferFrom(msg.sender, lender, lenderRepayment);

                // Update lender position
                lenderPositions[_loanId][lender].repaid = true;
                lenderPositions[_loanId][lender].repaidAmount = lenderRepayment;
            }
        }

        // Update loan status
        loan.status = LoanStatus.REPAID;

        // Return collateral to borrower
        _returnCollateral(_loanId);

        emit LoanRepaid(_loanId, msg.sender, totalRepayment);
    }

    /**
     * @dev Return collateral to borrower
     */
    function _returnCollateral(uint256 _loanId) internal {
        Loan storage loan = loans[_loanId];
        require(!loan.collateralClaimed, "Collateral already claimed");

        if (loan.collateralAmount > 0) {
            _transferTokens(loan.collateralToken, loan.borrower, loan.collateralAmount);
            loan.collateralClaimed = true;
        }
    }

    /**
     * @dev Internal function to transfer tokens
     */
    function _transferTokens(TokenType _tokenType, address _to, uint256 _amount) internal {
        if (_tokenType == TokenType.NATIVE_ETH) {
            (bool success, ) = payable(_to).call{value: _amount}("");
            require(success, "ETH transfer failed");
        } else {
            Token memory token = supportedTokens[_tokenType];
            IERC20(token.contractAddress).safeTransfer(_to, _amount);
        }
    }

    /**
     * @dev Get loan details
     */
    function getLoan(uint256 _loanId) external view returns (Loan memory) {
        return loans[_loanId];
    }

    /**
     * @dev Get active loan requests for browsing
     */
    function getActiveLoanRequests() external view returns (uint256[] memory) {
        uint256[] memory activeLoanIds = new uint256[](nextLoanId - 1);
        uint256 count = 0;

        for (uint256 i = 1; i < nextLoanId; i++) {
            if (loans[i].status == LoanStatus.REQUESTED || loans[i].status == LoanStatus.PARTIALLY_FUNDED) {
                activeLoanIds[count] = i;
                count++;
            }
        }

        // Resize array to actual count
        uint256[] memory result = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = activeLoanIds[i];
        }

        return result;
    }

    /**
     * @dev Get supported token details
     */
    function getSupportedToken(TokenType _tokenType) external view returns (Token memory) {
        return supportedTokens[_tokenType];
    }

    /**
     * @dev Get current token price with staleness check
     */
    function getTokenPrice(TokenType _tokenType) external view returns (uint256) {
        PriceData memory priceData = tokenPrices[_tokenType];
        require(
            block.timestamp - priceData.lastUpdate <= PRICE_STALENESS_THRESHOLD,
            "Price data is stale"
        );
        return priceData.price;
    }

    /**
     * @dev Get detailed price information
     */
    function getTokenPriceInfo(TokenType _tokenType) external view returns (
        uint256 price,
        uint256 lastUpdate,
        uint256 source1,
        uint256 source2,
        uint256 updateCount,
        bool isStale
    ) {
        PriceData memory priceData = tokenPrices[_tokenType];
        return (
            priceData.price,
            priceData.lastUpdate,
            priceData.priceSource1,
            priceData.priceSource2,
            priceData.updateCount,
            block.timestamp - priceData.lastUpdate > PRICE_STALENESS_THRESHOLD
        );
    }

    /**
     * @dev Claim insurance for defaulted loan (lenders only)
     */
    function claimInsurance(uint256 _loanId) external nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.id != 0, "Loan does not exist");
        require(loan.status == LoanStatus.DEFAULTED, "Loan is not defaulted");
        require(loan.hasInsurance, "Loan does not have insurance");
        require(!hasClaimedInsurance[_loanId][msg.sender], "Insurance already claimed by this lender");
        require(
            block.timestamp >= loan.dueDate + CLAIM_GRACE_PERIOD,
            "Grace period not ended"
        );

        // Calculate total amount contributed by this lender (may have funded multiple times)
        bool isLender = false;
        uint256 lenderAmount = 0;
        for (uint256 i = 0; i < loan.lenders.length; i++) {
            if (loan.lenders[i] == msg.sender) {
                isLender = true;
                lenderAmount += loan.lenderAmounts[i];
            }
        }
        require(isLender, "Not a lender on this loan");
        require(lenderAmount > 0, "No amount to claim");

        // Calculate insurance payout (proportional to lender's contribution)
        uint256 totalInsuranceFund = insurancePools[loan.loanToken];

        // Ensure sufficient insurance funds
        require(totalInsuranceFund > 0, "No insurance funds available");

        // Calculate proportional insurance payout
        uint256 insurancePayout = (lenderAmount * loan.insuranceFee) / loan.totalAmount;
        require(insurancePayout <= totalInsuranceFund, "Insufficient insurance funds");

        // Mark insurance as claimed for this lender
        hasClaimedInsurance[_loanId][msg.sender] = true;

        // Reduce insurance pool
        insurancePools[loan.loanToken] -= insurancePayout;

        // Transfer insurance payout to lender
        if (loan.loanToken == TokenType.NATIVE_ETH) {
            (bool success, ) = msg.sender.call{value: insurancePayout}("");
            require(success, "ETH transfer failed");
        } else {
            Token memory loanTokenInfo = supportedTokens[loan.loanToken];
            IERC20(loanTokenInfo.contractAddress).safeTransfer(msg.sender, insurancePayout);
        }

        emit InsuranceClaimed(_loanId, msg.sender, insurancePayout);
    }

    /**
     * @dev Add funds to insurance pool (anyone can contribute)
     */
    function contributeToInsurancePool(TokenType _tokenType, uint256 _amount) external payable nonReentrant {
        require(_amount > 0, "Amount must be positive");

        if (_tokenType == TokenType.NATIVE_ETH) {
            require(msg.value == _amount, "ETH amount mismatch");
        } else {
            require(msg.value == 0, "No ETH should be sent");
            Token memory tokenInfo = supportedTokens[_tokenType];
            IERC20(tokenInfo.contractAddress).safeTransferFrom(msg.sender, address(this), _amount);
        }

        insurancePools[_tokenType] += _amount;
        lenderInsuranceContributions[msg.sender] += _amount;

        emit InsurancePoolContribution(_tokenType, _amount);
    }

    /**
     * @dev Get insurance pool balance for a token
     */
    function getInsurancePoolBalance(TokenType _tokenType) external view returns (uint256) {
        return insurancePools[_tokenType];
    }

    /**
     * @dev Get insurance status for a loan
     */
    function getInsuranceStatus(uint256 _loanId, address _lender) external view returns (
        bool hasInsurance,
        uint256 insuranceFee,
        bool isClaimed,
        bool canClaim
    ) {
        Loan storage loan = loans[_loanId];
        require(loan.id != 0, "Loan does not exist");

        hasInsurance = loan.hasInsurance;
        insuranceFee = loan.insuranceFee;
        isClaimed = hasClaimedInsurance[_loanId][_lender];

        // Check if the address is a lender and calculate total contribution
        bool isLender = false;
        uint256 totalContribution = 0;
        for (uint256 i = 0; i < loan.lenders.length; i++) {
            if (loan.lenders[i] == _lender) {
                isLender = true;
                totalContribution += loan.lenderAmounts[i];
            }
        }

        canClaim = loan.hasInsurance &&
                  loan.status == LoanStatus.DEFAULTED &&
                  !hasClaimedInsurance[_loanId][_lender] &&
                  isLender &&
                  totalContribution > 0 &&
                  block.timestamp >= loan.dueDate + CLAIM_GRACE_PERIOD;

        return (hasInsurance, insuranceFee, isClaimed, canClaim);
    }

    /**
     * @dev Get all loan IDs for a borrower
     */
    function getBorrowerLoans(address _borrower) external view returns (uint256[] memory) {
        return borrowerLoans[_borrower];
    }

    /**
     * @dev Get all loan IDs for a lender  
     */
    function getLenderLoans(address _lender) external view returns (uint256[] memory) {
        return lenderLoans[_lender];
    }
}

contracts/LoanVerse.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

/**
 * @title LoanVerse
 * @dev Next-generation DeFi lending platform with multi-token support and credit scoring
 */
contract LoanVerse is ReentrancyGuard, Ownable, Pausable {
    using SafeERC20 for IERC20;

    enum LoanStatus { 
        REQUESTED,    // Loan requested by borrower
        FUNDED,       // Loan funded by lender
        REPAID,       // Loan fully repaid
        DEFAULTED,    // Loan defaulted (collateral liquidated)
        CANCELLED,    // Loan cancelled by borrower
        LIQUIDATING   // Collateral being liquidated
    }

    enum TokenType {
        ETH,
        ERC20
    }

    struct Token {
        TokenType tokenType;
        address contractAddress;  // 0x0 for ETH
        string symbol;
        uint8 decimals;
        bool isActive;
    }

    struct CreditScore {
        uint256 score;           // 300-850 credit score (standard credit score range)
        uint256 totalLoansCount;
        uint256 repaidLoansCount;
        uint256 defaultedLoansCount;
        uint256 totalBorrowed;
        uint256 totalRepaid;
        uint256 lastUpdated;
    }

    struct Loan {
        uint256 id;
        address borrower;
        address lender;
        uint256 tokenId;          // ID of the token being borrowed
        uint256 collateralTokenId; // ID of the collateral token
        uint256 amount;           // Loan amount
        uint256 collateralAmount; // Collateral amount
        uint256 interestRate;     // Interest rate (basis points)
        uint256 duration;         // Loan duration in seconds
        uint256 createdAt;
        uint256 fundedAt;
        uint256 dueDate;
        LoanStatus status;
        string ipfsDocumentHash;  // IPFS hash for loan documents
        uint256 riskScore;        // AI-calculated risk score (0-1000)
        bool collateralClaimed;
    }

    // State variables
    uint256 public nextLoanId = 1;
    uint256 public nextTokenId = 1;
    uint256 public constant MIN_COLLATERAL_RATIO = 150; // 150%
    uint256 public constant MAX_INTEREST_RATE = 3000;   // 30% max
    uint256 public constant MIN_LOAN_DURATION = 1 days;
    uint256 public constant MAX_LOAN_DURATION = 365 days;
    uint256 public constant MIN_CREDIT_SCORE = 300; // Minimum credit score (300-850 range)

    // Protocol fees
    uint256 public protocolFeeRate = 50; // 0.5% in basis points
    address public feeRecipient;
    uint256 public collectedFees;

    // Mappings
    mapping(uint256 => Loan) public loans;
    mapping(uint256 => Token) public supportedTokens;
    mapping(address => uint256[]) public borrowerLoans;
    mapping(address => uint256[]) public lenderLoans;
    mapping(address => CreditScore) public creditScores;
    mapping(address => bool) public authorizedRiskOracles;

    // Events
    event TokenAdded(uint256 indexed tokenId, address indexed contractAddress, string symbol);
    event TokenDeactivated(uint256 indexed tokenId);

    event LoanRequested(
        uint256 indexed loanId,
        address indexed borrower,
        uint256 indexed tokenId,
        uint256 amount,
        uint256 collateralAmount,
        uint256 interestRate,
        uint256 duration,
        string ipfsHash
    );

    event LoanFunded(uint256 indexed loanId, address indexed lender);
    event LoanRepaid(uint256 indexed loanId, uint256 repaidAmount);
    event LoanDefaulted(uint256 indexed loanId);
    event LoanCancelled(uint256 indexed loanId);
    event CollateralClaimed(uint256 indexed loanId, uint256 amount);

    event CreditScoreUpdated(address indexed borrower, uint256 newScore);
    event RiskScoreUpdated(uint256 indexed loanId, uint256 riskScore);

    modifier onlyAuthorizedOracle() {
        require(authorizedRiskOracles[msg.sender], "Not authorized oracle");
        _;
    }

    constructor() Ownable(msg.sender) {
        feeRecipient = msg.sender;

        // Add ETH as the first supported token
        supportedTokens[0] = Token({
            tokenType: TokenType.ETH,
            contractAddress: address(0),
            symbol: "ETH",
            decimals: 18,
            isActive: true
        });
    }

    /**
     * @dev Add a new supported ERC20 token
     */
    function addSupportedToken(
        address _contractAddress,
        string memory _symbol,
        uint8 _decimals
    ) external onlyOwner {
        require(_contractAddress != address(0), "Invalid contract address");

        supportedTokens[nextTokenId] = Token({
            tokenType: TokenType.ERC20,
            contractAddress: _contractAddress,
            symbol: _symbol,
            decimals: _decimals,
            isActive: true
        });

        emit TokenAdded(nextTokenId, _contractAddress, _symbol);
        nextTokenId++;
    }

    /**
     * @dev Deactivate a supported token
     */
    function deactivateToken(uint256 _tokenId) external onlyOwner {
        require(supportedTokens[_tokenId].isActive, "Token not active");
        supportedTokens[_tokenId].isActive = false;
        emit TokenDeactivated(_tokenId);
    }

    /**
     * @dev Set authorized risk oracle
     */
    function setAuthorizedOracle(address _oracle, bool _authorized) external onlyOwner {
        authorizedRiskOracles[_oracle] = _authorized;
    }

    /**
     * @dev Update risk score for a loan (called by authorized oracle)
     */
    function updateRiskScore(uint256 _loanId, uint256 _riskScore) external onlyAuthorizedOracle {
        require(_riskScore <= 1000, "Invalid risk score");
        require(loans[_loanId].borrower != address(0), "Loan does not exist");

        loans[_loanId].riskScore = _riskScore;
        emit RiskScoreUpdated(_loanId, _riskScore);
    }

    /**
     * @dev Request a loan with multi-token support
     */
    function requestLoan(
        uint256 _tokenId,
        uint256 _collateralTokenId,
        uint256 _amount,
        uint256 _interestRate,
        uint256 _duration,
        string memory _ipfsDocumentHash
    ) external payable nonReentrant whenNotPaused {
        require(_amount > 0, "Amount must be greater than 0");
        require(_interestRate <= MAX_INTEREST_RATE, "Interest rate too high");
        require(_duration >= MIN_LOAN_DURATION && _duration <= MAX_LOAN_DURATION, "Invalid duration");
        require(supportedTokens[_tokenId].isActive, "Token not supported");
        require(supportedTokens[_collateralTokenId].isActive, "Collateral token not supported");
        require(bytes(_ipfsDocumentHash).length > 0, "IPFS hash required");

        // Check minimum credit score
        require(creditScores[msg.sender].score >= MIN_CREDIT_SCORE || 
                creditScores[msg.sender].totalLoansCount == 0, "Credit score too low");

        uint256 requiredCollateral = (_amount * MIN_COLLATERAL_RATIO) / 100;

        if (supportedTokens[_collateralTokenId].tokenType == TokenType.ETH) {
            require(msg.value >= requiredCollateral, "Insufficient ETH collateral");
        } else {
            require(msg.value == 0, "ETH not needed for ERC20 collateral");
            IERC20 collateralToken = IERC20(supportedTokens[_collateralTokenId].contractAddress);
            require(collateralToken.balanceOf(msg.sender) >= requiredCollateral, "Insufficient ERC20 balance");
            collateralToken.safeTransferFrom(msg.sender, address(this), requiredCollateral);
        }

        uint256 loanId = nextLoanId++;

        loans[loanId] = Loan({
            id: loanId,
            borrower: msg.sender,
            lender: address(0),
            tokenId: _tokenId,
            collateralTokenId: _collateralTokenId,
            amount: _amount,
            collateralAmount: supportedTokens[_collateralTokenId].tokenType == TokenType.ETH ? 
                              msg.value : requiredCollateral,
            interestRate: _interestRate,
            duration: _duration,
            createdAt: block.timestamp,
            fundedAt: 0,
            dueDate: 0,
            status: LoanStatus.REQUESTED,
            ipfsDocumentHash: _ipfsDocumentHash,
            riskScore: 0,
            collateralClaimed: false
        });

        borrowerLoans[msg.sender].push(loanId);

        emit LoanRequested(
            loanId, 
            msg.sender, 
            _tokenId, 
            _amount, 
            loans[loanId].collateralAmount, 
            _interestRate, 
            _duration,
            _ipfsDocumentHash
        );
    }

    /**
     * @dev Fund a loan with multi-token support
     */
    function fundLoan(uint256 _loanId) external payable nonReentrant whenNotPaused {
        Loan storage loan = loans[_loanId];
        require(loan.borrower != address(0), "Loan does not exist");
        require(loan.status == LoanStatus.REQUESTED, "Loan not available");
        require(msg.sender != loan.borrower, "Cannot fund own loan");

        loan.lender = msg.sender;
        loan.status = LoanStatus.FUNDED;
        loan.fundedAt = block.timestamp;
        loan.dueDate = block.timestamp + loan.duration;

        lenderLoans[msg.sender].push(_loanId);

        if (supportedTokens[loan.tokenId].tokenType == TokenType.ETH) {
            require(msg.value == loan.amount, "Incorrect ETH amount");
            (bool success, ) = payable(loan.borrower).call{value: loan.amount}("");
            require(success, "Transfer to borrower failed");
        } else {
            require(msg.value == 0, "ETH not needed for ERC20 loan");
            IERC20 token = IERC20(supportedTokens[loan.tokenId].contractAddress);
            token.safeTransferFrom(msg.sender, loan.borrower, loan.amount);
        }

        emit LoanFunded(_loanId, msg.sender);
    }

    /**
     * @dev Repay a loan with interest
     */
    function repayLoan(uint256 _loanId) external payable nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.borrower == msg.sender, "Only borrower can repay");
        require(loan.status == LoanStatus.FUNDED, "Loan not active");
        require(block.timestamp <= loan.dueDate, "Loan expired");

        uint256 interest = (loan.amount * loan.interestRate) / 10000;
        uint256 protocolFee = (interest * protocolFeeRate) / 10000;
        uint256 lenderPayment = loan.amount + interest - protocolFee;
        uint256 totalRepayment = loan.amount + interest;

        loan.status = LoanStatus.REPAID;
        collectedFees += protocolFee;

        if (supportedTokens[loan.tokenId].tokenType == TokenType.ETH) {
            require(msg.value >= totalRepayment, "Insufficient repayment");

            (bool success1, ) = payable(loan.lender).call{value: lenderPayment}("");
            require(success1, "Transfer to lender failed");

            if (msg.value > totalRepayment) {
                (bool success2, ) = payable(msg.sender).call{value: msg.value - totalRepayment}("");
                require(success2, "Excess return failed");
            }
        } else {
            require(msg.value == 0, "ETH not needed for ERC20 repayment");
            IERC20 token = IERC20(supportedTokens[loan.tokenId].contractAddress);
            token.safeTransferFrom(msg.sender, loan.lender, lenderPayment);
            if (protocolFee > 0) {
                token.safeTransferFrom(msg.sender, feeRecipient, protocolFee);
            }
        }

        // Return collateral
        _returnCollateral(_loanId);

        // Update credit score
        _updateCreditScore(loan.borrower, true);

        emit LoanRepaid(_loanId, totalRepayment);
    }

    /**
     * @dev Claim collateral after default
     */
    function claimCollateral(uint256 _loanId) external nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.lender == msg.sender, "Only lender can claim");
        require(loan.status == LoanStatus.FUNDED, "Loan not active");
        require(block.timestamp > loan.dueDate, "Loan not expired");
        require(!loan.collateralClaimed, "Already claimed");

        loan.status = LoanStatus.DEFAULTED;
        loan.collateralClaimed = true;

        // Transfer collateral to lender
        if (supportedTokens[loan.collateralTokenId].tokenType == TokenType.ETH) {
            (bool success, ) = payable(loan.lender).call{value: loan.collateralAmount}("");
            require(success, "Collateral transfer failed");
        } else {
            IERC20 collateralToken = IERC20(supportedTokens[loan.collateralTokenId].contractAddress);
            collateralToken.safeTransfer(loan.lender, loan.collateralAmount);
        }

        // Update credit score for default
        _updateCreditScore(loan.borrower, false);

        emit LoanDefaulted(_loanId);
        emit CollateralClaimed(_loanId, loan.collateralAmount);
    }

    /**
     * @dev Cancel unfunded loan
     */
    function cancelLoan(uint256 _loanId) external nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.borrower == msg.sender, "Only borrower can cancel");
        require(loan.status == LoanStatus.REQUESTED, "Can only cancel unfunded loans");

        loan.status = LoanStatus.CANCELLED;

        // Return collateral
        _returnCollateral(_loanId);

        emit LoanCancelled(_loanId);
    }

    /**
     * @dev Internal function to return collateral
     */
    function _returnCollateral(uint256 _loanId) internal {
        Loan storage loan = loans[_loanId];

        if (supportedTokens[loan.collateralTokenId].tokenType == TokenType.ETH) {
            (bool success, ) = payable(loan.borrower).call{value: loan.collateralAmount}("");
            require(success, "Collateral return failed");
        } else {
            IERC20 collateralToken = IERC20(supportedTokens[loan.collateralTokenId].contractAddress);
            collateralToken.safeTransfer(loan.borrower, loan.collateralAmount);
        }
    }

    /**
     * @dev Internal function to update credit score
     */
    function _updateCreditScore(address _borrower, bool _repaid) internal {
        CreditScore storage score = creditScores[_borrower];

        if (score.totalLoansCount == 0) {
            score.score = 575; // Starting score (middle of 300-850 range)
        }

        score.totalLoansCount++;
        score.lastUpdated = block.timestamp;

        if (_repaid) {
            score.repaidLoansCount++;
            // Increase score for successful repayment (clamped to max 850)
            score.score = score.score + 10 > 850 ? 850 : score.score + 10;
        } else {
            score.defaultedLoansCount++;
            // Decrease score for default (clamped to min 300)
            score.score = score.score > 50 ? (score.score - 50 < 300 ? 300 : score.score - 50) : 300;
        }

        emit CreditScoreUpdated(_borrower, score.score);
    }

    /**
     * @dev Get active loan requests for funding
     */
    function getActiveLoanRequests() external view returns (uint256[] memory) {
        uint256[] memory activeLoanIds = new uint256[](nextLoanId - 1);
        uint256 count = 0;

        for (uint256 i = 1; i < nextLoanId; i++) {
            if (loans[i].status == LoanStatus.REQUESTED) {
                activeLoanIds[count] = i;
                count++;
            }
        }

        uint256[] memory result = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = activeLoanIds[i];
        }

        return result;
    }

    /**
     * @dev Emergency pause
     */
    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Withdraw collected fees
     */
    function withdrawFees() external onlyOwner {
        uint256 amount = collectedFees;
        collectedFees = 0;

        (bool success, ) = payable(feeRecipient).call{value: amount}("");
        require(success, "Fee withdrawal failed");
    }
}

contracts/LoanVerseV3.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

// Chainlink Price Feed Interface
interface AggregatorV3Interface {
    function decimals() external view returns (uint8);
    function description() external view returns (string memory);
    function version() external view returns (uint256);
    function getRoundData(uint80 _roundId)
        external
        view
        returns (
            uint80 roundId,
            int256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        );
    function latestRoundData()
        external
        view
        returns (
            uint80 roundId,
            int256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        );
}

/**
 * @title LoanVerseV3
 * @dev Advanced DeFi lending platform with Chainlink oracles and automated liquidation
 */
contract LoanVerseV3 is ReentrancyGuard, Ownable, Pausable {
    using SafeERC20 for IERC20;

    enum LoanStatus { 
        REQUESTED,      // Loan requested by borrower
        FUNDED,         // Loan funded by lender
        REPAID,         // Loan fully repaid
        DEFAULTED,      // Loan defaulted (collateral liquidated)
        CANCELLED,      // Loan cancelled by borrower
        LIQUIDATING     // Collateral being liquidated
    }

    enum TokenType {
        ETH,
        ERC20
    }

    struct Token {
        TokenType tokenType;
        address contractAddress;  // 0x0 for ETH
        string symbol;
        uint8 decimals;
        bool isActive;
        AggregatorV3Interface priceFeed; // Chainlink price feed
    }

    struct CreditScore {
        uint256 score;           // 300-850 credit score (standard credit score range)
        uint256 totalLoansCount;
        uint256 repaidLoansCount;
        uint256 defaultedLoansCount;
        uint256 totalBorrowed;
        uint256 totalRepaid;
        uint256 lastUpdated;
    }

    struct Loan {
        uint256 id;
        address borrower;
        address lender;
        uint256 tokenId;          // ID of the token being borrowed
        uint256 collateralTokenId; // ID of the collateral token
        uint256 amount;           // Loan amount
        uint256 collateralAmount; // Collateral amount
        uint256 interestRate;     // Interest rate (basis points)
        uint256 duration;         // Loan duration in seconds
        uint256 createdAt;
        uint256 fundedAt;
        uint256 dueDate;
        LoanStatus status;
        string ipfsDocumentHash;  // IPFS hash for loan documents
        uint256 riskScore;        // AI-calculated risk score (0-1000)
        bool collateralClaimed;
        uint256 liquidationThreshold; // Liquidation threshold percentage (e.g., 120%)
        uint256 lastHealthCheck;  // Last time collateral health was checked
    }

    struct LiquidationAuction {
        uint256 loanId;
        uint256 startTime;
        uint256 endTime;
        uint256 startingPrice;
        uint256 reservePrice;
        address highestBidder;
        uint256 highestBid;
        bool active;
    }

    // State variables
    uint256 public nextLoanId = 1;
    uint256 public nextTokenId = 1;
    uint256 public nextAuctionId = 1;
    uint256 public constant MIN_COLLATERAL_RATIO = 150; // 150%
    uint256 public constant LIQUIDATION_THRESHOLD = 120; // 120%
    uint256 public constant MAX_INTEREST_RATE = 3000;   // 30% max
    uint256 public constant MIN_LOAN_DURATION = 1 days;
    uint256 public constant MAX_LOAN_DURATION = 365 days;
    uint256 public constant MIN_CREDIT_SCORE = 300; // Minimum credit score (300-850 range)
    uint256 public constant AUCTION_DURATION = 24 hours; // 24 hour auctions
    uint256 public constant PRICE_STALENESS_THRESHOLD = 3600; // 1 hour

    // Protocol fees
    uint256 public protocolFeeRate = 50; // 0.5% in basis points
    uint256 public liquidationFeeRate = 300; // 3% liquidation fee
    address public feeRecipient;
    uint256 public collectedFees;

    // Dynamic interest rate parameters
    uint256 public baseInterestRate = 500; // 5% base rate
    uint256 public utilizationOptimal = 8000; // 80% optimal utilization
    uint256 public rateSlope1 = 400; // 4% increase before optimal
    uint256 public rateSlope2 = 6000; // 60% increase after optimal

    // Mappings
    mapping(uint256 => Loan) public loans;
    mapping(uint256 => Token) public supportedTokens;
    mapping(address => uint256[]) public borrowerLoans;
    mapping(address => uint256[]) public lenderLoans;
    mapping(address => CreditScore) public creditScores;
    mapping(address => bool) public authorizedRiskOracles;
    mapping(uint256 => LiquidationAuction) public liquidationAuctions;
    mapping(uint256 => uint256) public tokenUtilization; // Track utilization for dynamic rates

    // Events
    event TokenAdded(uint256 indexed tokenId, address indexed contractAddress, string symbol, address priceFeed);
    event TokenDeactivated(uint256 indexed tokenId);

    event LoanRequested(
        uint256 indexed loanId,
        address indexed borrower,
        uint256 indexed tokenId,
        uint256 amount,
        uint256 collateralAmount,
        uint256 interestRate,
        uint256 duration,
        string ipfsHash
    );

    event LoanFunded(uint256 indexed loanId, address indexed lender);
    event LoanRepaid(uint256 indexed loanId, uint256 repaidAmount);
    event LoanDefaulted(uint256 indexed loanId);
    event LoanCancelled(uint256 indexed loanId);
    event CollateralClaimed(uint256 indexed loanId, uint256 amount);
    event LiquidationTriggered(uint256 indexed loanId, uint256 currentRatio, uint256 threshold);
    event AuctionStarted(uint256 indexed auctionId, uint256 indexed loanId, uint256 startingPrice, uint256 endTime);
    event BidPlaced(uint256 indexed auctionId, address indexed bidder, uint256 amount);
    event AuctionFinalized(uint256 indexed auctionId, address indexed winner, uint256 finalPrice);

    event CreditScoreUpdated(address indexed borrower, uint256 newScore);
    event RiskScoreUpdated(uint256 indexed loanId, uint256 riskScore);
    event InterestRateUpdated(uint256 indexed tokenId, uint256 newRate);

    modifier onlyAuthorizedOracle() {
        require(authorizedRiskOracles[msg.sender], "Not authorized oracle");
        _;
    }

    constructor() Ownable(msg.sender) {
        feeRecipient = msg.sender;

        // Add ETH as the first supported token (no price feed needed for ETH/USD on mainnet)
        supportedTokens[0] = Token({
            tokenType: TokenType.ETH,
            contractAddress: address(0),
            symbol: "ETH",
            decimals: 18,
            isActive: true,
            priceFeed: AggregatorV3Interface(address(0)) // Will be set later with actual Chainlink feed
        });
    }

    /**
     * @dev Add a new supported ERC20 token with Chainlink price feed
     */
    function addSupportedToken(
        address _contractAddress,
        string memory _symbol,
        uint8 _decimals,
        address _priceFeedAddress
    ) external onlyOwner {
        require(_contractAddress != address(0), "Invalid contract address");
        require(_priceFeedAddress != address(0), "Invalid price feed address");

        supportedTokens[nextTokenId] = Token({
            tokenType: TokenType.ERC20,
            contractAddress: _contractAddress,
            symbol: _symbol,
            decimals: _decimals,
            isActive: true,
            priceFeed: AggregatorV3Interface(_priceFeedAddress)
        });

        emit TokenAdded(nextTokenId, _contractAddress, _symbol, _priceFeedAddress);
        nextTokenId++;
    }

    /**
     * @dev Update price feed for a token
     */
    function updatePriceFeed(uint256 _tokenId, address _priceFeedAddress) external onlyOwner {
        require(supportedTokens[_tokenId].isActive, "Token not active");
        supportedTokens[_tokenId].priceFeed = AggregatorV3Interface(_priceFeedAddress);
    }

    /**
     * @dev Get latest price from Chainlink oracle
     */
    function getLatestPrice(uint256 _tokenId) public view returns (uint256, uint256) {
        Token memory token = supportedTokens[_tokenId];
        require(token.isActive, "Token not supported");

        if (address(token.priceFeed) == address(0)) {
            // For tokens without price feed (like ETH in testnet), return mock price
            return (200000000000, block.timestamp); // $2000 USD with 8 decimals
        }

        (
            uint80 roundId,
            int256 price,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        ) = token.priceFeed.latestRoundData();

        require(price > 0, "Invalid price from oracle");
        require(updatedAt > 0, "Round not complete");
        require(block.timestamp - updatedAt <= PRICE_STALENESS_THRESHOLD, "Price data too old");

        return (uint256(price), updatedAt);
    }

    /**
     * @dev Calculate USD value of token amount
     */
    function calculateUSDValue(uint256 _tokenId, uint256 _amount) public view returns (uint256) {
        (uint256 price, ) = getLatestPrice(_tokenId);
        Token memory token = supportedTokens[_tokenId];

        // Adjust for token decimals and price feed decimals (8)
        if (token.decimals <= 8) {
            return (_amount * price) / (10 ** token.decimals);
        } else {
            return (_amount * price) / (10 ** token.decimals) / (10 ** (token.decimals - 8));
        }
    }

    /**
     * @dev Check if loan is underwater (collateral < threshold)
     */
    function isLoanUnderwater(uint256 _loanId) public view returns (bool, uint256) {
        Loan memory loan = loans[_loanId];
        require(loan.borrower != address(0), "Loan does not exist");
        require(loan.status == LoanStatus.FUNDED, "Loan not active");

        uint256 collateralValueUSD = calculateUSDValue(loan.collateralTokenId, loan.collateralAmount);
        uint256 loanValueUSD = calculateUSDValue(loan.tokenId, loan.amount);

        uint256 currentRatio = (collateralValueUSD * 100) / loanValueUSD;

        return (currentRatio < loan.liquidationThreshold, currentRatio);
    }

    /**
     * @dev Calculate dynamic interest rate based on utilization
     */
    function calculateDynamicRate(uint256 _tokenId) public view returns (uint256) {
        uint256 utilization = tokenUtilization[_tokenId];

        if (utilization <= utilizationOptimal) {
            // Below optimal: rate increases linearly
            uint256 excessUtilization = (utilization * 10000) / utilizationOptimal;
            return baseInterestRate + (rateSlope1 * excessUtilization) / 10000;
        } else {
            // Above optimal: steep increase
            uint256 excessUtilization = utilization - utilizationOptimal;
            return baseInterestRate + rateSlope1 + (rateSlope2 * excessUtilization) / (10000 - utilizationOptimal);
        }
    }

    /**
     * @dev Request a loan with dynamic interest rate
     */
    function requestLoan(
        uint256 _tokenId,
        uint256 _collateralTokenId,
        uint256 _amount,
        uint256 _maxInterestRate,
        uint256 _duration,
        string memory _ipfsDocumentHash
    ) external payable nonReentrant whenNotPaused {
        require(_amount > 0, "Amount must be greater than 0");
        require(_duration >= MIN_LOAN_DURATION && _duration <= MAX_LOAN_DURATION, "Invalid duration");
        require(supportedTokens[_tokenId].isActive, "Token not supported");
        require(supportedTokens[_collateralTokenId].isActive, "Collateral token not supported");
        require(bytes(_ipfsDocumentHash).length > 0, "IPFS hash required");

        // Check minimum credit score
        require(creditScores[msg.sender].score >= MIN_CREDIT_SCORE || 
                creditScores[msg.sender].totalLoansCount == 0, "Credit score too low");

        // Calculate dynamic interest rate
        uint256 dynamicRate = calculateDynamicRate(_tokenId);
        require(dynamicRate <= _maxInterestRate, "Interest rate too high");

        // Calculate required collateral using current prices
        uint256 loanValueUSD = calculateUSDValue(_tokenId, _amount);
        uint256 requiredCollateralUSD = (loanValueUSD * MIN_COLLATERAL_RATIO) / 100;

        (uint256 collateralPrice, ) = getLatestPrice(_collateralTokenId);
        Token memory collateralToken = supportedTokens[_collateralTokenId];
        uint256 requiredCollateral = (requiredCollateralUSD * (10 ** collateralToken.decimals)) / collateralPrice;

        if (supportedTokens[_collateralTokenId].tokenType == TokenType.ETH) {
            require(msg.value >= requiredCollateral, "Insufficient ETH collateral");
        } else {
            require(msg.value == 0, "ETH not needed for ERC20 collateral");
            IERC20 collateralTokenContract = IERC20(supportedTokens[_collateralTokenId].contractAddress);
            require(collateralTokenContract.balanceOf(msg.sender) >= requiredCollateral, "Insufficient ERC20 balance");
            collateralTokenContract.safeTransferFrom(msg.sender, address(this), requiredCollateral);
        }

        uint256 loanId = nextLoanId++;

        loans[loanId] = Loan({
            id: loanId,
            borrower: msg.sender,
            lender: address(0),
            tokenId: _tokenId,
            collateralTokenId: _collateralTokenId,
            amount: _amount,
            collateralAmount: supportedTokens[_collateralTokenId].tokenType == TokenType.ETH ? 
                              msg.value : requiredCollateral,
            interestRate: dynamicRate,
            duration: _duration,
            createdAt: block.timestamp,
            fundedAt: 0,
            dueDate: 0,
            status: LoanStatus.REQUESTED,
            ipfsDocumentHash: _ipfsDocumentHash,
            riskScore: 0,
            collateralClaimed: false,
            liquidationThreshold: LIQUIDATION_THRESHOLD,
            lastHealthCheck: block.timestamp
        });

        borrowerLoans[msg.sender].push(loanId);

        emit LoanRequested(
            loanId, 
            msg.sender, 
            _tokenId, 
            _amount, 
            loans[loanId].collateralAmount, 
            dynamicRate, 
            _duration,
            _ipfsDocumentHash
        );
    }

    /**
     * @dev Fund a loan
     */
    function fundLoan(uint256 _loanId) external payable nonReentrant whenNotPaused {
        Loan storage loan = loans[_loanId];
        require(loan.borrower != address(0), "Loan does not exist");
        require(loan.status == LoanStatus.REQUESTED, "Loan not available");
        require(msg.sender != loan.borrower, "Cannot fund own loan");

        loan.lender = msg.sender;
        loan.status = LoanStatus.FUNDED;
        loan.fundedAt = block.timestamp;
        loan.dueDate = block.timestamp + loan.duration;

        lenderLoans[msg.sender].push(_loanId);

        // Update utilization
        tokenUtilization[loan.tokenId] += loan.amount;

        if (supportedTokens[loan.tokenId].tokenType == TokenType.ETH) {
            require(msg.value == loan.amount, "Incorrect ETH amount");
            (bool success, ) = payable(loan.borrower).call{value: loan.amount}("");
            require(success, "Transfer to borrower failed");
        } else {
            require(msg.value == 0, "ETH not needed for ERC20 loan");
            IERC20 token = IERC20(supportedTokens[loan.tokenId].contractAddress);
            token.safeTransferFrom(msg.sender, loan.borrower, loan.amount);
        }

        emit LoanFunded(_loanId, msg.sender);
        emit InterestRateUpdated(loan.tokenId, calculateDynamicRate(loan.tokenId));
    }

    /**
     * @dev Trigger liquidation for underwater loan
     */
    function liquidateLoan(uint256 _loanId) external nonReentrant {
        (bool underwater, uint256 currentRatio) = isLoanUnderwater(_loanId);
        require(underwater, "Loan is not underwater");

        Loan storage loan = loans[_loanId];
        loan.status = LoanStatus.LIQUIDATING;

        // Start liquidation auction
        uint256 auctionId = startLiquidationAuction(_loanId);

        emit LiquidationTriggered(_loanId, currentRatio, loan.liquidationThreshold);
    }

    /**
     * @dev Start liquidation auction
     */
    function startLiquidationAuction(uint256 _loanId) internal returns (uint256) {
        Loan memory loan = loans[_loanId];

        // Calculate starting price (current collateral value)
        uint256 collateralValueUSD = calculateUSDValue(loan.collateralTokenId, loan.collateralAmount);
        uint256 startingPrice = collateralValueUSD;
        uint256 reservePrice = (collateralValueUSD * 80) / 100; // 80% of current value

        uint256 auctionId = nextAuctionId++;

        liquidationAuctions[auctionId] = LiquidationAuction({
            loanId: _loanId,
            startTime: block.timestamp,
            endTime: block.timestamp + AUCTION_DURATION,
            startingPrice: startingPrice,
            reservePrice: reservePrice,
            highestBidder: address(0),
            highestBid: 0,
            active: true
        });

        emit AuctionStarted(auctionId, _loanId, startingPrice, block.timestamp + AUCTION_DURATION);

        return auctionId;
    }

    /**
     * @dev Place bid in liquidation auction
     */
    function placeBid(uint256 _auctionId) external payable nonReentrant {
        LiquidationAuction storage auction = liquidationAuctions[_auctionId];
        require(auction.active, "Auction not active");
        require(block.timestamp <= auction.endTime, "Auction ended");
        require(msg.value > auction.highestBid, "Bid too low");
        require(msg.value >= auction.reservePrice, "Bid below reserve");

        // Refund previous highest bidder
        if (auction.highestBidder != address(0)) {
            (bool success, ) = payable(auction.highestBidder).call{value: auction.highestBid}("");
            require(success, "Refund failed");
        }

        auction.highestBidder = msg.sender;
        auction.highestBid = msg.value;

        emit BidPlaced(_auctionId, msg.sender, msg.value);
    }

    /**
     * @dev Finalize liquidation auction
     */
    function finalizeAuction(uint256 _auctionId) external nonReentrant {
        LiquidationAuction storage auction = liquidationAuctions[_auctionId];
        require(auction.active, "Auction not active");
        require(block.timestamp > auction.endTime, "Auction still ongoing");

        auction.active = false;

        Loan storage loan = loans[auction.loanId];

        if (auction.highestBidder != address(0)) {
            // Successful auction
            loan.status = LoanStatus.DEFAULTED;
            loan.collateralClaimed = true;

            // Calculate payments
            uint256 loanValueUSD = calculateUSDValue(loan.tokenId, loan.amount);
            uint256 interest = (loan.amount * loan.interestRate) / 10000;
            uint256 totalOwed = loan.amount + interest;
            uint256 liquidationFee = (auction.highestBid * liquidationFeeRate) / 10000;

            // Pay lender (up to amount owed)
            uint256 lenderPayment = totalOwed < auction.highestBid ? totalOwed : auction.highestBid;
            if (supportedTokens[loan.tokenId].tokenType == TokenType.ETH) {
                (bool success1, ) = payable(loan.lender).call{value: lenderPayment}("");
                require(success1, "Lender payment failed");
            }

            // Pay protocol fee
            collectedFees += liquidationFee;

            // Remaining goes to borrower (if any)
            uint256 remaining = auction.highestBid - lenderPayment - liquidationFee;
            if (remaining > 0) {
                (bool success2, ) = payable(loan.borrower).call{value: remaining}("");
                require(success2, "Borrower payment failed");
            }

            // Transfer collateral to auction winner
            if (supportedTokens[loan.collateralTokenId].tokenType == TokenType.ETH) {
                (bool success3, ) = payable(auction.highestBidder).call{value: loan.collateralAmount}("");
                require(success3, "Collateral transfer failed");
            } else {
                IERC20 collateralToken = IERC20(supportedTokens[loan.collateralTokenId].contractAddress);
                collateralToken.safeTransfer(auction.highestBidder, loan.collateralAmount);
            }

            emit AuctionFinalized(_auctionId, auction.highestBidder, auction.highestBid);
        } else {
            // No bids - return collateral to borrower, loan remains defaulted
            loan.status = LoanStatus.DEFAULTED;
            _returnCollateral(auction.loanId);
        }

        // Update utilization
        tokenUtilization[loan.tokenId] -= loan.amount;

        // Update credit score for default
        _updateCreditScore(loan.borrower, false);

        emit LoanDefaulted(auction.loanId);
        emit InterestRateUpdated(loan.tokenId, calculateDynamicRate(loan.tokenId));
    }

    /**
     * @dev Repay a loan with interest
     */
    function repayLoan(uint256 _loanId) external payable nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.borrower == msg.sender, "Only borrower can repay");
        require(loan.status == LoanStatus.FUNDED, "Loan not active");
        require(block.timestamp <= loan.dueDate, "Loan expired");

        uint256 interest = (loan.amount * loan.interestRate) / 10000;
        uint256 protocolFee = (interest * protocolFeeRate) / 10000;
        uint256 lenderPayment = loan.amount + interest - protocolFee;
        uint256 totalRepayment = loan.amount + interest;

        loan.status = LoanStatus.REPAID;
        collectedFees += protocolFee;

        // Update utilization
        tokenUtilization[loan.tokenId] -= loan.amount;

        if (supportedTokens[loan.tokenId].tokenType == TokenType.ETH) {
            require(msg.value >= totalRepayment, "Insufficient repayment");

            (bool success1, ) = payable(loan.lender).call{value: lenderPayment}("");
            require(success1, "Transfer to lender failed");

            if (msg.value > totalRepayment) {
                (bool success2, ) = payable(msg.sender).call{value: msg.value - totalRepayment}("");
                require(success2, "Excess return failed");
            }
        } else {
            require(msg.value == 0, "ETH not needed for ERC20 repayment");
            IERC20 token = IERC20(supportedTokens[loan.tokenId].contractAddress);
            token.safeTransferFrom(msg.sender, loan.lender, lenderPayment);
            if (protocolFee > 0) {
                token.safeTransferFrom(msg.sender, feeRecipient, protocolFee);
            }
        }

        // Return collateral
        _returnCollateral(_loanId);

        // Update credit score
        _updateCreditScore(loan.borrower, true);

        emit LoanRepaid(_loanId, totalRepayment);
        emit InterestRateUpdated(loan.tokenId, calculateDynamicRate(loan.tokenId));
    }

    /**
     * @dev Internal function to return collateral
     */
    function _returnCollateral(uint256 _loanId) internal {
        Loan storage loan = loans[_loanId];

        if (supportedTokens[loan.collateralTokenId].tokenType == TokenType.ETH) {
            (bool success, ) = payable(loan.borrower).call{value: loan.collateralAmount}("");
            require(success, "Collateral return failed");
        } else {
            IERC20 collateralToken = IERC20(supportedTokens[loan.collateralTokenId].contractAddress);
            collateralToken.safeTransfer(loan.borrower, loan.collateralAmount);
        }
    }

    /**
     * @dev Internal function to update credit score
     */
    function _updateCreditScore(address _borrower, bool _repaid) internal {
        CreditScore storage score = creditScores[_borrower];

        if (score.totalLoansCount == 0) {
            score.score = 575; // Starting score (middle of 300-850 range)
        }

        score.totalLoansCount++;
        score.lastUpdated = block.timestamp;

        if (_repaid) {
            score.repaidLoansCount++;
            // Increase score for successful repayment (clamped to max 850)
            score.score = score.score + 10 > 850 ? 850 : score.score + 10;
        } else {
            score.defaultedLoansCount++;
            // Decrease score for default (clamped to min 300)
            score.score = score.score > 50 ? (score.score - 50 < 300 ? 300 : score.score - 50) : 300;
        }

        emit CreditScoreUpdated(_borrower, score.score);
    }

    /**
     * @dev Get active loan requests for funding
     */
    function getActiveLoanRequests() external view returns (uint256[] memory) {
        uint256[] memory activeLoanIds = new uint256[](nextLoanId - 1);
        uint256 count = 0;

        for (uint256 i = 1; i < nextLoanId; i++) {
            if (loans[i].status == LoanStatus.REQUESTED) {
                activeLoanIds[count] = i;
                count++;
            }
        }

        uint256[] memory result = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = activeLoanIds[i];
        }

        return result;
    }

    /**
     * @dev Get loans eligible for liquidation
     */
    function getLoansEligibleForLiquidation() external view returns (uint256[] memory) {
        uint256[] memory eligibleLoanIds = new uint256[](nextLoanId - 1);
        uint256 count = 0;

        for (uint256 i = 1; i < nextLoanId; i++) {
            if (loans[i].status == LoanStatus.FUNDED) {
                (bool underwater, ) = isLoanUnderwater(i);
                if (underwater) {
                    eligibleLoanIds[count] = i;
                    count++;
                }
            }
        }

        uint256[] memory result = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = eligibleLoanIds[i];
        }

        return result;
    }

    /**
     * @dev Emergency pause
     */
    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Withdraw collected fees
     */
    function withdrawFees() external onlyOwner {
        uint256 amount = collectedFees;
        collectedFees = 0;

        (bool success, ) = payable(feeRecipient).call{value: amount}("");
        require(success, "Fee withdrawal failed");
    }

    /**
     * @dev Update liquidation parameters
     */
    function updateLiquidationParams(
        uint256 _liquidationFeeRate,
        uint256 _auctionDuration
    ) external onlyOwner {
        require(_liquidationFeeRate <= 1000, "Fee too high"); // Max 10%
        require(_auctionDuration >= 1 hours && _auctionDuration <= 7 days, "Invalid duration");

        liquidationFeeRate = _liquidationFeeRate;
        // Note: auction duration is constant, but could be made variable
    }

    /**
     * @dev Update dynamic rate parameters
     */
    function updateDynamicRateParams(
        uint256 _baseRate,
        uint256 _utilizationOptimal,
        uint256 _rateSlope1,
        uint256 _rateSlope2
    ) external onlyOwner {
        require(_utilizationOptimal <= 10000, "Invalid optimal utilization");
        require(_baseRate <= 2000, "Base rate too high"); // Max 20%

        baseInterestRate = _baseRate;
        utilizationOptimal = _utilizationOptimal;
        rateSlope1 = _rateSlope1;
        rateSlope2 = _rateSlope2;
    }
}

